INSERT INTO `negocios` (`code`, `name`) VALUES
('BR001', 'User Authentication | Defines the authentication process for users.'),
('BR002', 'Payment Processing | Handles all payment gateway interactions.'),
('BR003', 'Data Encryption | Ensures data is encrypted before storage or transmission.'),
('BR004', 'User Profile Management | Manages user profile creation and updates.'),
('BR005', 'Order Fulfillment | Describes the steps involved in processing customer orders.'),
('BR006', 'Inventory Tracking | Tracks inventory levels and restocks automatically.'),
('BR007', 'Shipping Calculator | Calculates shipping costs based on destination and weight.'),
('BR008', 'Discount Application | Applies discounts based on user loyalty or promotions.'),
('BR009', 'Notification System | Manages the notification system for updates to users.'),
('BR010', 'Product Review | Allows users to submit and view product reviews.'),
('BR011', 'Account Suspension | Suspends user accounts based on policy violations.'),
('BR012', 'Password Reset | Handles the process for resetting user passwords.'),
('BR013', 'Tax Calculation | Calculates taxes for transactions based on location.'),
('BR014', 'Refund Policy | Defines the rules and process for customer refunds.'),
('BR015', 'Subscription Management | Manages subscription plans and billing cycles.'),
('BR016', 'Customer Support | Handles customer support tickets and queries.'),
('BR017', 'Loyalty Program | Defines rules for earning and redeeming loyalty points.'),
('BR018', 'Session Timeout | Automatically logs out users after a period of inactivity.'),
('BR019', 'API Rate Limiting | Limits the number of API requests a user can make per hour.'),
('BR020', 'Content Moderation | Filters and flags inappropriate user-generated content.'),
('BR021', 'Access Control | Defines roles and permissions for accessing system features.'),
('BR022', 'Data Retention | Specifies the duration for which user data is stored.'),
('BR023', 'Login Attempt Lockout | Locks user accounts after multiple failed login attempts.'),
('BR024', 'Geo-location Restriction | Restricts access to services based on the userâ€™s location.'),
('BR025', 'Email Confirmation | Requires email confirmation before activating user accounts.'),
('BR026', 'Two-Factor Authentication | Enforces two-factor authentication for extra security.'),
('BR027', 'Audit Trail | Logs user activity for security and compliance purposes.'),
('BR028', 'Service Level Agreement | Defines the service levels agreed upon with customers.'),
('BR029', 'Customer Feedback | Collects and processes customer feedback to improve services.'),
('BR030', 'Data Backup | Automatically backs up data at regular intervals.');
